import { useState, useEffect } from 'react';
const Fetch = () => {
  const [liibraries, setLibraries] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/library')
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setLibraries(data);
      });
  }, []);
  return (
    <div>

      {liibraries.map((liibrary) => (

        <div>
            <p key={liibrary.libname}>{libname}</p>
        <p key={liibrary.ownername}>{ownername}</p>
        <p key={liibrary.gmail}>{gmail}</p>
        <p key={liibrary.contactnumber}>{contactnumber}</p>
        <p key={liibrary.libid}>{libid}</p></div>
      ))}
    </div>
  );
};
export default Fetch;
